import styled from "styled-components";

export const Services = styled.div`
color : #fff;
padding: 160px 0;
background: ${({lightBg}) => (lightBg ? '#E8E9F7' : '#200752')};
`

export const Title = styled.div`
display: flex;
flex-direction: row;
width: 100%;
`
